div.script:
$(function () {
    if (isCookieEnabled()) {
        if (document.cookie.indexOf("closePromoCodeAd=1") < 0) $(".shutterBannerWp").fadeIn('fast');
    }
    else $(".shutterBannerWp").fadeIn('fast');
    $('#closeShutterStockPromo').on('click', function () {
        $('.shutterBannerWp').fadeOut('fast');
        if (isCookieEnabled()) {
            if (document.cookie.indexOf("closePromoCodeAd=1") < 0) {
                document.cookie = "closePromoCodeAd=1";
            }
        }
    });
});
